  false,\n\t\"url\": null,\n\t\"notes\": \"This shapefile maps the survey routes of
  the Herp 2001 Inventory crews for Pipe Springs National Monument. The other parks
  visited were Bryce Canyon, Capitol Reef, Cedar Breaks, Fossil Butte, Golden Spike,
